import React from "react"
import { Link } from "react-router-dom"

const Wishlist = () => {
  return (
    <div className="wishlist-sticky">
      <Link to="#" className="wishlist-card">
        <i class="fa-solid fa-heart"></i>
        <span>My Wishlist</span>
      </Link>
    </div>
  )
}

export default Wishlist
